  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:39.180110\",\n\t\"name\": \"a-comparison-of-biologically-active-elements-in-geese-in-relation-to-avian-cholera\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Avian cholera caused an estimated mortality
  of between 166,000 to 197,000 migrating waterfowl in the Rainwater Basin of Nebraska
  in the 10-year period 1975 through 1984. Livers were collected from 10 geese with
  a presumptive diagnosis for avian cholera and 5 geese for controls with a diagnosis
  of death due to causes other than avian cholera. The 15 livers were analyzed for
  14 biologically active elements. It is concluded that there was no direct cause
  and effect relationship between avian cholera in the 10 geese sampled and the individual
  elements of selenium, cadmium, copper, chromium, iron, manganese, lead, and zinc.
  The liver burdens of arsenic, mercury, nickel, and thallium were so low they were
  considered as having no cause and effect relationship with avian cholera in the
  geese studied. The concentrations of beryllium were quite low. However, the paucity
  of literature on the subject precluded any assumption in relation to avian cholera.
  The concentrations of aluminum in the livers of both groups of geese from the Rainwater
  Basin were 6 to 28 times higher than those of seven other populations of birds unaffected
  by avian cholera. This difference of aluminum concentrations in the livers should
  be pursued further in the available literature. Continuation of a literature review
  is recommended to provide a better basis for the interpretation of the importance
  of elevated concentrations of aluminum, beryllium, and lead in bird livers. Continuing
  the study of biologically active elements is recommended to relate tissue concentrations
  of antimony, barium, boron, calcium, magnesium, molybdenum, silver, strontium, and
  vanadium to avian cholera. A study is recommended to relate the use of agricultural
  pesticides in waterfowl wintering areas to the springtime occurrence of avian cholera
  in the Rainwater Basin.  Study the possible relationships between the occurrence
  of mycotoxins and the occurrence of avian cholera in the Rainwater Basin.\",\n\t\"license_title\":
